) src
ON (dest.category_code = src.c_code AND dest.icon_name = src.n)
WHEN MATCHED THEN
    UPDATE SET 
        dest.category_name = src.c_name, 
        dest.tags = src.t
WHEN NOT MATCHED THEN
    INSERT (category_code, category_name, icon_name, tags)
    VALUES (src.c_code, src.c_name, src.n, src.t);
